// MainPage.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './mainpage.css'; // Ensure your CSS file is in the correct location
import heading from './assets/heading3.png'; // Fix the extra space in the path
import Background from './Background';

const MainPage = () => {
  const navigate = useNavigate();

  const handleVisualizerClick = () => {
    navigate('/visualizer');
  };

  return (
    <div className="mp">
      <Background />
      {/* Use the imported 'heading' directly as the src */}
      <img className = "head"src={heading} alt="Letter Heading" style={{ height: '45px', width: 'auto' ,fill:'white'}} />
      <h1></h1>
      <div className = "content-box">
        <p> Visualize to Understand, Learn to Master!" The DSA Algorithm Visualizer is your go-to tool for mastering data structures and algorithms through interactive learning.        </p>
      </div>
      <button className="direct" onClick={handleVisualizerClick}>
        Get Started
      </button>
    </div>
  );
};

export default MainPage;
